import React from 'react';
import '../css/cardCss.css'

type Props = {
    user: string,
    age: number,
}

const UsersList = (props: { props: Props[] }) => {

    const data = props.props;

    return (
        <ul>
            {data.map((data: Props) => {
                <li className={'card input'}>
                    <text>{data.user} ({data.age} years old)</text>
                </li>
            })}
        </ul>
    )
};

export default UsersList;
